import React, { Component } from 'react';
import Customer from './components/Customer';
import './App.css';


const customer = {
  'name': 'aaa',
  'birthday': '111',
  'gender': 'bbb',
  'job': 'ccc'
}
class App extends Component {
  render() {
    return (
     <Customer 
        name = {customer.name}
        birthday = {customer.birthday}
        gender = {customer.gender}
        job = {customer.job}
     />
    );
  }
}

export default App;
